import React from 'react';
import { Button, Card, Container, Row, Col } from 'react-bootstrap';
import Header from '../components/Header.js';

function Home()
{
    return (
        <div className="Home">
            <header className="Home-header">
                <Header />
            </header>
            <Container>
                <Row>
                    <Col>
                        Testing
                    </Col>
                </Row>
            </Container>
        </div>
    );
}

export default Home;
